import React from "react";
import  ReactDOM  from "react-dom";
import Home from "./Home";
import TestDetail from "./TestDetail"
import GoodScore from "./GoodScore";
import GetAdmission from "./GetAdmission";
import Contact from './Contact';


import { BrowserRouter as Router, Routes, Route, Link }  from "react-router-dom";
import './index.css';

import Navbar from './Navbar';
import Footer from './Footer';
ReactDOM.render(
  <>
  <Navbar/>


  <Routes>
    <Route path="/" element={Home} />
    <Route excat path="/contact" element={<Contact/>} />
    <Route excat path="/Test detail" element={TestDetail} />
    <Route excat path="/Good Score" element={GoodScore} />
    <Route excat path="/Get admission" element={GetAdmission} />
    </Routes>




  <Footer/>
  </>,
  document.getElementById("root")
);
